filament_start_gcode:
{if notes=~/.*QUALITY.*/ and nozzle_diameter[0]==0.4}
SET_PRESSURE_ADVANCE EXTRUDER=extruder ADVANCE=0.0 SMOOTH_TIME=0.025

{elsif notes=~/.*CASUAL.*/ and nozzle_diameter[0]==0.4}
SET_PRESSURE_ADVANCE EXTRUDER=extruder ADVANCE=0.032 SMOOTH_TIME=0.025

{elsif notes=~/.*QUALITY.*/ and nozzle_diameter[0]==0.5}
SET_PRESSURE_ADVANCE EXTRUDER=extruder ADVANCE=0.0 SMOOTH_TIME=0.025

{elsif notes=~/.*CASUAL.*/ and nozzle_diameter[0]==0.5}
SET_PRESSURE_ADVANCE EXTRUDER=extruder ADVANCE=0.0 SMOOTH_TIME=0.025
{endif}

SET_RETRACTION RETRACT_LENGTH=0.5
SET_RETRACTION UNRETRACT_EXTRA_LENGTH=0
SET_RETRACTION RETRACT_SPEED=20
SET_RETRACTION UNRETRACT_SPEED=20
